\begin{equation*}
	\begin{cases}
		\mbox{Adiabatic: } Q=0 \implies E_{\mathrm{int}}= W\\
		\mbox{Constant } V\mbox{: } W=0\implies E_{\mathrm{int}}= Q\\
		\mbox{Cycle: } E_{\mathrm{int}}= 0 \implies Q_{\mathrm{TOT}}=W_{\mathrm{TOT}}\\
		\mbox{Free: } \Delta E_{\mathrm{int}}=0
	\end{cases}
\end{equation*}

\begin{equation*}
	W=\begin{cases}
		nRT\ln\frac{V_f}{V_i}\mbox{ constant } T\\
		0\mbox{ constant } V\\
		p\Delta V\mbox{ constant } p
	\end{cases}
\end{equation*}
